Au fil des jours, les petits bonhommes verts sont devenus une attraction locale, avec des foules de gens qui se pressaient pour les voir. Les gens ont commenc  les nourrir et  leur offrir des cadeaux, ravis d''avoir des visiteurs si inhabituels.
        
Finalement, les petits bonhommes verts ont repris leur voyage, quittant la ville aussi soudainement qu''ils taient venus. Mais ils ont laiss une impression durable sur la ville et ses habitants, qui ont t merveills par leur visite. Les petits bonhommes verts taient peut-tre tranges, mais ils taient aussi une source de joie et d''merveillement, une preuve qu''il y a toujours des choses  dcouvrir dans ce monde vaste et merveilleux.', true);
