INSERT INTO product (product_id, name, price, description, image_content, image_content_type, long_desc, is_active) VALUES ('plante', 'Plante verte', 45.99, 'Une plante avec un feuillage vert.', '\', 'image/jpeg', 'Notre plante verte est une beaut naturelle, avec des feuilles paisses et luxuriantes qui se dveloppent en cascade gracieuse. Ses feuilles vertes vibrantes ajoutent de la couleur et de la vie  n''importe quelle pice, tout en crant une atmosphre dtendue et paisible. Cette plante est galement facile  entretenir, ce qui la rend idale pour les dbutants en jardinage.

