INSERT INTO product (product_id, name, price, description, image_content, image_content_type, long_desc, is_active) VALUES ('voiture', 'Voiture verte', 20995.00, 'Elle est littralement verte mais met tout de mme des GES.', '\', 'image/jpeg', 'La Mazda 2 est une petite voiture sous-compacte qui offre une excellente maniabilit et une bonne conomie de carburant. Elle dispose galement d''un intrieur spacieux et bien quip, avec des fonctionnalits modernes telles qu''un cran tactile, une camra de recul et des systmes d''assistance  la conduite.

