INSERT INTO product (product_id, name, price, description, image_content, image_content_type, long_desc, is_active) VALUES ('panier', 'Panier vert', 7.95, 'Toute est dans toute.', '\', 'image/jpeg', 'Il tait une fois, dans une contre lointaine, une petite fille nomme lodie. lodie vivait dans un petit village nich au milieu d''une fort dense. Un jour, alors qu''elle se promenait dans la fort, elle trouva un panier vert tress avec une plante magique.

merveille par sa dcouverte, lodie ramassa le panier et examina la plante. Elle remarqua que chaque brin de la plante avait une couleur diffrente et qu''ils semblaient changer de teinte en fonction de la lumire. Intrigue, elle dcida de ramener le panier chez elle pour l''tudier de plus prs.

Une fois chez elle, lodie commena  examiner le panier et la plante avec soin. Elle passa des heures  tudier chaque brin de la plante,  essayer de comprendre son origine et son pouvoir. Soudain, elle eut une ide. Elle dcida de tresser un autre panier avec les brins de la plante magique, dans l''espoir de dcouvrir son pouvoir secret.

Elle passa des jours  tresser le panier, travaillant sans relche jusqu'' ce qu''il soit termin. Lorsqu''elle eut fini, elle posa le panier  ct de l''autre et s''assit pour les contempler. Soudain, quelque chose d''incroyable se produisit. Les deux paniers commencrent  briller et  mettre une lumire tincelante.

lodie se retrouva alors transporte dans un monde fantastique rempli de magie et de cratures tranges. Elle avait l''impression d''tre entre dans un rve veill. Elle rencontra des elfes, des fes et des dragons, tous merveills par le pouvoir des paniers magiques.

lodie comprit alors que la plante magique qui avait t utilise pour tresser les paniers avait le pouvoir de transporter les gens dans un monde fantastique. Elle dcida de partager son pouvoir avec les autres, en offrant les paniers verts tresss  tous ceux qui voulaient vivre une aventure magique.

Ainsi, le panier vert tress avec la plante magique devint clbre dans tout le pays, et lodie devint une hrone pour avoir dcouvert son pouvoir secret. Et depuis ce jour, les paniers verts tresss avec la plante magique sont devenus des symboles de magie et d''aventure, transportant les gens dans des mondes fantastiques et merveillant les esprits de tous ceux qui les voient.', true);
INSERT INTO product (product_id, name, price, description, image_content, image_content_type, long_desc, is_active) VALUES ('pomme', 'Pomme verte', 0.99, 'Un fruit qui vient du pommier.', '\', 'image/jpeg', 'Les pommes vertes sont non seulement dlicieuses, mais elles offrent galement de nombreux bienfaits pour la sant. Voici quelques-uns des avantages les plus importants des pommes vertes :

Riches en nutriments : Les pommes vertes sont riches en vitamines et en minraux essentiels, comme la vitamine C, la vitamine K, le potassium et le magnsium. Ces nutriments sont importants pour maintenir une bonne sant globale, renforcer le systme immunitaire et favoriser une bonne digestion.
        
Faibles en calories : Les pommes vertes sont une excellente collation faible en calories, ce qui en fait un choix idal pour ceux qui cherchent  perdre du poids ou  maintenir un poids sant. Une pomme verte moyenne ne contient qu''environ 95 calories.
        
Fibre alimentaire : Les pommes vertes sont riches en fibres alimentaires, ce qui en fait un excellent choix pour amliorer la digestion et rduire le risque de maladies cardiovasculaires et de diabte. La fibre aide galement  maintenir une sensation de satit plus longtemps, ce qui peut aider  viter les fringales.
        
Antioxydants : Les pommes vertes sont riches en antioxydants, qui aident  protger les cellules contre les dommages causs par les radicaux libres. Les antioxydants peuvent galement aider  rduire le risque de maladies chroniques, comme le cancer et les maladies cardiaques.
        
Bonnes pour les dents : Les pommes vertes sont croquantes et juteuses, ce qui peut aider  nettoyer les dents et  stimuler la production de salive. La salive est importante pour neutraliser les acides qui causent des caries dentaires et des maladies des gencives.
        
En rsum, les pommes vertes sont non seulement dlicieuses, mais elles offrent galement de nombreux bienfaits pour la sant. Incorporer des pommes vertes dans votre alimentation peut aider  maintenir une bonne sant globale et  rduire le risque de maladies chroniques. Alors la prochaine fois que vous cherchez une collation saine et savoureuse, pensez aux pommes vertes !', true);


